import React from "react";
import Nav from "../generalLayout/nav";
import SlideImgHomepage from "./slideImgHomePage";
import ReactDOM from "react-dom";
import {
  scrollFunction,
  ScrollMvSpecial,
  CheckNavCompact,
} from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import PageName from "../generalLayout/pageName";
import { FooterGe } from "../generalLayout/footer_test";
import MvEmail from "../generalLayout/mvEmail";
import MvTagType, { MvTagMobile, MvTagTypeMobile } from "../generalLayout/mvTagType";
import { MvSpecialModel } from "./mvSpecialModel";
const namePage = "MV Agusta Homepage";

export function BodyHomepage() {
  window.onscroll = function () {
    scrollFunction();
    // ScrollMvSpecial();
    CheckNavCompact();
  };
  return (
    <>
      {/* <div style={{ height: "63px" }}></div>
      <PageName namePage={namePage} />
      <Nav />
      <div className="mv-bg" id="main-bg">
        <SlideImgHomepage />
      </div>
      <div style={{ height: "10vh" }}></div>
      <div className="mv-about-us" id="mv-about-us"> */}
        {/* <AboutUs /> */}
      {/* </div>
      <div style={{ height: "15vh" }}></div> */}

      {/* <MvTagType />
      <MvTagTypeMobile /> */}
      <MvTagMobile />

      {/* <div style={{ height: 64 }}></div>
      <div className="mv-special-model" id="mv-special-model">
        <MvSpecialModel />
      </div>
      <div className="mv-special-part">
        <div className="left-part">
          <div className="left-content">
            <div>
              <a href>APPAREL</a>
            </div>
          </div>
        </div>
        <div className="right-part">
          <div className="right-content">
            <div>
              <a href>SPECIAL PARTS</a>
            </div>
          </div>
        </div>
      </div>
      <MvEmail />
      <br />
      <br /> */}
      {/* <Footer /> */}
      {/* <FooterGe /> */}
    </>
  );
}
const NavChosenHome = () => {
  return (
    <>
      <div className="mv-container-div nav-name-chosen">
        <p className="nav-name">Home</p>
      </div>
    </>
  );
};
window.onload = function () {
  ReactDOM.render(
    <NavChosenHome />,
    document.getElementsByClassName("mv-nav-container")[1]
  );
  document
    .getElementsByClassName("nav-name-chosen")[0]
    .classList.remove("mv-container-div");
};
